import styled from "styled-components";

const Hamburger = styled.div`
  position: absolute;
  cursor: pointer;

  background: lime;
  left: 2%;
  top: 5%;
  border-radius: 50%;
  height: 100px;
  width: 100px;
  transform: translate() (-50%, -5%);
  z-index: 2;
`;
const Nav = styled.div`
  position: relative;
`;
const Line = styled.div`
  background: grey;
  width: 30px;
  height: 3px;
  border-radius: 20%;
  margin: 5px;
`;
const NavLinks = styled.div`
  position: fixed;
  background: cyan;
  height: 100vh;
  width: 100%;
  flex-direction: column;
  clip-path: cirlce(100px at 90% -10%);
  -webkit-clip-path: cirlce(100px at 90% -10%);
  transition: all 1s ease-out;
  pointer-events: none;
`;
